chrome.runtime.onMessage.addListener(
  function(request, sender, sendResponse) {
    if (request.greeting == "takeScreenShot"){
		takeScreenShot();
		chrome.extension.getBackgroundPage().console.log("calling take screenshot ",screenShotURL);
		sendResponse({farewell: screenShotURL});}
});

function callOverlay(){
	var canvas = document.getElementById("S1A1imgCanvas");
	var context = canvas.getContext("2d");
	var myImg = new Image();
	myImg.src = "data:image/png;base64,";
	//chrome.extension.getBackgroundPage().console.log("image ", myImg.height, myImg.width)
	var sourceX = 400;
    var sourceY = 100;
    var destWidth = 850;
    var destHeight = 400;
	var sourceWidth = myImg.width - destWidth;
    var sourceHeight = myImg.height - destHeight;
    var destX = canvas.width / 2 - destWidth / 2;
    var destY = canvas.height / 2 - destHeight / 2;
 
     context.drawImage(myImg, sourceX, sourceY, sourceWidth, sourceHeight, destX, destY, destWidth, destHeight);
	
	chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
		chrome.tabs.sendMessage(tabs[0].id, {greeting: "overlayScreen"}, function(response) {
			//chrome.extension.getBackgroundPage().console.log("response from script.js ", canvas, myImg, context);
		});
	});
}



